import Link from "next/link";

const Layout = ({ children }) => {
  return (
    <div>
      <header>
        <Link href="/">
          <a>Podcast</a>
        </Link>
      </header>
      {children}
      <style jsx>{`
        header {
          color: white;
          background: #8756ca;
          padding: 15px;
          text-align: center;
        }
      `}</style>
      <style jsx global>
        {`
          body {
            margin: 0;
            font-family: system-ui;
            background: white;
          }
        `}
      </style>
    </div>
  );
};

export default Layout;
